import React, { Component } from 'react';

class Recipe extends Component {
    render() {
        return (
            <>
                <div className="col-md-4">
                    <h2>{this.props.name}</h2>
                    <h2>{this.props.age}</h2>
                    <h2>{this.props.phone}</h2>
                </div>
            </>
        );
    }
}

export default Recipe;
